import Create from "./components/Pages/Innovation";
import { createMuiTheme, ThemeProvider } from "@material-ui/core";
import Layout from "./components/Layout";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import InnovationSecondPage from "./components/Pages/InnovationSecondPage";
import Dashboard from "./components/Pages/Dashboard";

const theme = createMuiTheme({
  palette: {
    primary: {
      main: "#002d84",
    },
  },
  typography: {
    fontFamily: "Raleway",
    fontWeightLight: 100,
    fontWeightRegular: 300,
    fontWeightMedium: 700,
    fontWeightBold: 800,
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Router>
        <div>
          <Layout />
          <div>
            <Switch>
              <Route exact path="/" component={Dashboard} />
              <Route exact path="/users" component={Dashboard} />
              <Route exact path="/products & orders" component={Dashboard} />
              <Route exact path="/exhibits" component={Dashboard} />
              <Route exact path="/reports" component={Dashboard} />
            </Switch>
          </div>
        </div>
      </Router>
    </ThemeProvider>
  );
}

export default App;
